import { useEffect } from 'react';
import Router from 'next/router';
import useRequest from '../../hooks/use-request';
import axios from 'axios';


export default () => {
  const { doRequest } = useRequest({
    url: '/api/signout',
    method: 'post',
    body: {},
    onSuccess: () => Router.push('/')
  });

  useEffect(() => {
    doRequest();
  }, []);

  return <div>Signing you out...</div>;
};
